func compare(vals0, vals1 []float64, prec float64) error {
	for i := range vals0 {
		if math.Abs(vals0[i]-vals1[i]) > prec {
			return fmt.Errorf("Values not match: index=%d, %.10f != %.10f", i, vals0[i], vals1[i])
		}
	}
	return nil
}
